subroutine lebedev_init
	use data_lebedev
	implicit none
!
	integer :: i = 0
!
	if ( LBDVInited .eqv. .TRUE. ) then
		return
	end if
	
	allocate(LBDVGrids(NLBDVGridsMax))

	i = i + 1
	LBDVGrids(i)%L = 3
	LBDVGrids(i)%N = NLigSpher3
	LBDVGrids(i)%ptr => LSphericalGP3

	i = i + 1
	LBDVGrids(i)%L = 5
	LBDVGrids(i)%N = NLigSpher5
	LBDVGrids(i)%ptr => LSphericalGP5

	i = i + 1
	LBDVGrids(i)%L = 7
	LBDVGrids(i)%N = NLigSpher7
	LBDVGrids(i)%ptr => LSphericalGP7
	
	i = i + 1
	LBDVGrids(i)%L = 9
	LBDVGrids(i)%N = NLigSpher9
	LBDVGrids(i)%ptr => LSphericalGP9
	
	i = i + 1
	LBDVGrids(i)%L = 11
	LBDVGrids(i)%N = NLigSpher11
	LBDVGrids(i)%ptr => LSphericalGP11

	i = i + 1
	LBDVGrids(i)%L = 13
	LBDVGrids(i)%N = NLigSpher13
	LBDVGrids(i)%ptr => LSphericalGP13

	i = i + 1
	LBDVGrids(i)%L = 17
	LBDVGrids(i)%N = NLigSpher17
	LBDVGrids(i)%ptr => LSphericalGP17
	
	i = i + 1
	LBDVGrids(i)%L = 19
	LBDVGrids(i)%N = NLigSpher19
	LBDVGrids(i)%ptr => LSphericalGP19
	
	i = i + 1
	LBDVGrids(i)%L = 23
	LBDVGrids(i)%N = NLigSpher23
	LBDVGrids(i)%ptr => LSphericalGP23
	
	i = i + 1
	LBDVGrids(i)%L = 29
	LBDVGrids(i)%N = NLigSpher29
	LBDVGrids(i)%ptr => LSphericalGP29
	
	i = i + 1
	LBDVGrids(i)%L = 35
	LBDVGrids(i)%N = NLigSpher35
	LBDVGrids(i)%ptr => LSphericalGP35
	
	i = i + 1
	LBDVGrids(i)%L = 47
	LBDVGrids(i)%N = NLigSpher47
	LBDVGrids(i)%ptr => LSphericalGP47
	
	i = i + 1
	LBDVGrids(i)%L = 59
	LBDVGrids(i)%N = NLigSpher59
	LBDVGrids(i)%ptr => LSphericalGP59
	
	NLBDVGrids = i
	
	! radial shells
	NRS = (/ 35, 40, 45, 50, 60 /)
	
	! angular lebedev grids
	GSA = (/  7,  9, 11, 13, 17 /)
	GSB = (/  9, 11, 13, 17, 23 /)
	GSC = (/ 11, 13, 17, 19, 29 /)
	GSD = (/ 17, 19, 23, 29, 35 /)
	GSE = (/ 19, 23, 29, 35, 47 /)
	
	LBDVInited = .TRUE.

end subroutine


subroutine get_lebedev_grid_type(k, kmax, Ltype)
	use data_lebedev
	use global_c
	implicit none
!
	integer, intent(in) :: k, kmax
	integer, intent(out) :: Ltype
!
	call lebedev_init

	if ( ( OPruning .eqv. .FALSE. ) .OR. ( kmax - k .ge. 2 * kmax / 3 ) ) then
		Ltype = GSE(nGrid)
	else if ( kmax - k .lt. kmax / 5 ) then
		Ltype = GSA(nGrid)
	else if ( kmax - k .lt. kmax / 3 ) then
		Ltype = GSB(nGrid)
	else if ( kmax - k .lt. kmax * 5 / 10 ) then
		Ltype = GSC(nGrid)
	else
		Ltype = GSD(nGrid)
	end if

end subroutine


subroutine get_lebedev_grid_size(L, N)
	use data_lebedev
	implicit none
!
	integer, intent(in) :: L
	integer, intent(out) :: N
	integer :: k
!
	call lebedev_init

	do k = 1, NLBDVGrids
		if ( L .eq. LBDVGrids(k)%L ) then
			N = LBDVGrids(k)%N
			return
		end if
	end do

	write(*,*) "ERROR! Lebedev grid not implemented!"
	stop
	
end subroutine

subroutine get_lebedev_grid_point(L, i, x, y, z, dV)
	use data_lebedev
	implicit none
!
	integer, intent(in) :: L, i
	double precision, intent(out) :: x, y, z, dV
	integer :: k
!
	call lebedev_init

	do k = 1, NLBDVGrids
		if ( L .eq. LBDVGrids(k)%L ) then
			if ( ( i .gt. 0 ) .AND. ( i .le. LBDVGrids(k)%N ) ) then
				x = LBDVGrids(k)%ptr(i, 1)
				y = LBDVGrids(k)%ptr(i, 2)
				z = LBDVGrids(k)%ptr(i, 3)
				dV = LBDVGrids(k)%ptr(i, 4)
				return
			else
				write(*,*) "ERROR! Lebedev grid construction failed!", i, k
				stop
			end if
		
		end if
	end do
	
	write(*,*) "ERROR! Lebedev grid not implemented!"
	stop
	
end subroutine
